import React, {useState, useEffect, useRef} from "react";

// Anpassad hook för att spåra föregående värde
function usePrevious(value) {
  const ref = useRef();
  useEffect(() => {
    ref.current = value;
  });
  return ref.current;
}

function PatientApp() {
  const [patienter, setPatienter] = useState([]);
  const [currentValue, setCurrentValue] = useState(0);
  const previousValue = usePrevious(currentValue);

  // Uppdatera currentValue varje gång patienter ändras
  useEffect(() => {
    setCurrentValue(patienter.length);
  }, [patienter]);

  return (
    <div>
      <p>Nuvarande värde: {currentValue}</p>
      <p>Föregående värde: {previousValue}</p>
    </div>
  );
}

export default PatientApp;
